import React, { Component } from 'react';
import FormatListNumberedIcon from '@material-ui/icons/FormatListNumbered';
import SettingsIcon from '@material-ui/icons/Settings';
import TimerIcon from '@material-ui/icons/Timer';
import GroupIcon from '@material-ui/icons/Group';

import Paper from '@material-ui/core/Paper';

import { MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles';


import { BrowserRouter as Router, Switch, Route, NavLink}from 'react-router-dom';

import PropTypes from 'prop-types';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';

import Notifications from './dashboard/Notifications.js';
import Exerciselist from './exercises/ExerciseList';

import { connect } from 'react-redux';

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={3}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
};

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function a11yProps(index) {
  return {
    id: `simple-tab-${index}`,
    'aria-controls': `simple-tabpanel-${index}`,
  };
};

const [value, setValue] = React.useState(0);

class Dashboard extends Component {

  render(){



    const handleChange = (event, newValue) => {
      setValue(newValue);
    };

    // Or Create your Own theme:
    const theme = createMuiTheme({
    palette: {
      secondary: {
        main: '#23985F'
      }
    }})

    console.log(this.props);



    return (
    <div>
      <Router>
          <Switch>
            <Route exact path="/home" component={Notifications}>
              <Notifications />
            </Route>
            <Route exact path="/exercises">
              <Paper square className="paper">
                <MuiThemeProvider theme={theme}>
                  <Tabs
                    value={value}
                    indicatorColor="secondary"
                    textColor="primary"
                    onChange={handleChange}
                    aria-label="disabled tabs example"
                    className="tabs"
                  >
                    <Tab label="chest" className="tab"  {...a11yProps(0)} />
                    <Tab label="bicep" className="tab" {...a11yProps(1)}/>
                    <Tab label="tricep" className="tab" {...a11yProps(2)}/>
                    <Tab label="back" className="tab" {...a11yProps(3)}/>
                  </Tabs>
                  <TabPanel value={value} index={0}>
                    <Exerciselist />
                  </TabPanel>
                  <TabPanel value={value} index={1}>
                    Bicep jajajaja
                  </TabPanel>
                  <TabPanel value={value} index={2}>
                    Tricep jajaja
                  </TabPanel>
                  <TabPanel value={value} index={3}>
                    Rug jajajaja
                  </TabPanel>
                </MuiThemeProvider>
              </Paper><br></br>
            </Route>
            <Route exact path="/progress">

              Andere Mjenson
              <br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br>

              {/* <TextField />
              <Dropdown />
              <PlusMinusField /> */}
            </Route>
            <Route exact path="/settings">
              Settings
            </Route>
          </Switch>

          <footer>
            <NavLink to="/home" activeClassName="activeLink" className="bottomnavitem"><TimerIcon /></NavLink>
            <NavLink to="/exercises" activeClassName="activeLink" className="bottomnavitem"><FormatListNumberedIcon /></NavLink>
            <NavLink to="/progress" activeClassName="activeLink" className="bottomnavitem"><GroupIcon /></NavLink>
            <NavLink to="/settings" activeClassName="activeLink" className="bottomnavitem"><SettingsIcon /></NavLink>
          </footer>
        </Router>
      </div>)
  }
}

const mapStateToProps = (state) => {
  return {
    exercises: state.exercise.exercises
  }
}

export default connect(mapStateToProps)(Dashboard);
